import React from 'react';
import ReactDOM from 'react-dom/client';

function Header(){
    return(<h1>hello</h1>)
}
const app = ReactDOM.createRoot(document.getElementById('header'))

function Footer(){
    return(<h1>foot</h1>)
}
const foot = ReactDOM.createRoot(document.getElementById('footer'))
app.render(<Header />)
foot.render(<Footer/>)
